import React from 'react';
import ResponsiveNavBar from "../Partials/Header"



function Drive() {
  return (
    <div className="flex flex-col min-h-screen overflow-hidden">

      {/*  Site header */}
      <ResponsiveNavBar />

      {/*  Page content */}
      <main className="flex flex-row py-44 px-8 justify-center text-black font-sans">

        <div className=' flex flex-col items-center justify-center  py-16 w-auto px-44 ' >
                <h1>Already a Driver ?</h1>
                <p>connect to your Driver Account</p>
                <button>Connect</button>
        </div>
        <div className=' flex items-center justify-center align-middle py-16 w-44 '><div className="text-gray-600 text-4xl italic font-semibold">Or</div></div>
        <div className=' flex flex-col items-center justify-center  py-16 w-auto px-44 '> 
                <h1>Become a Driver ?</h1>
                <p>create  your Driver Account</p>
                <button>Create Account</button>
        </div>
        {/*  Page sections */}


      </main>

      {/*  Site footer */}


    </div>
  );
}

export default Drive;
